import {  React , useState } from 'react'
import TodoForm from './componets/TodoForm/TodoForm'

const App = () => {
  let [ todos , setTodos ] = useState([]);
  const addTodo = (todo) => { 
    setTodos([todo , ...todo])
  }
  return ( 
    <div className='Container' >
      <TodoForm onSubmit={addTodo}/>
    </div>
  )
}

export default App
